package com.playus.clim.vo;

public class Clim {
	private int no, viewerCount, currentTime;
	private String nickname,poster,stealcut, title,genre, src;
	
	
	public Clim() {
		// TODO Auto-generated constructor stub
	}





	public int getCurrentTime() {
		return currentTime;
	}



	public void setCurrentTime(int currentTime) {
		this.currentTime = currentTime;
	}



	public String getSrc() {
		return src;
	}



	public void setSrc(String src) {
		this.src = src;
	}



	public int getNo() {
		return no;
	}


	public void setNo(int no) {
		this.no = no;
	}


	public int getViewerCount() {
		return viewerCount;
	}


	public void setViewerCount(int viewerCount) {
		this.viewerCount = viewerCount;
	}


	public String getNickname() {
		return nickname;
	}


	public void setNickname(String nickname) {
		this.nickname = nickname;
	}


	public String getPoster() {
		return poster;
	}


	public void setPoster(String poster) {
		this.poster = poster;
	}


	public String getStealcut() {
		return stealcut;
	}


	public void setStealcut(String stealcut) {
		this.stealcut = stealcut;
	}


	public String getTitle() {
		return title;
	}


	public void setTitle(String title) {
		this.title = title;
	}


	public String getGenre() {
		return genre;
	}


	public void setGenre(String genre) {
		this.genre = genre;
	}
	
	
	
}
